import Card from 'react-bootstrap/Card'
import Button from 'react-bootstrap/Button'

const Item = ({ item }) => {
    return (

            <Card style={{ width: '18rem' }}>
                <Card.Body>
                    <Card.Title>{item.name}</Card.Title>
                    <Card.Text>
                    {item.desc}
                    </Card.Text>
                    <Button variant="primary">ADD</Button>
                </Card.Body>
            </Card>


    );
};

export default Item
